import React from "react";
import "./contact.css";
const ContactUs = () => {
  return (
    <>
      <h1>Get In Touch</h1>
      <div className="container">
        <form action="">
          <input type="text" placeholder="Your Name" />
          <input type="email" placeholder="Your Email" />
          <input type="text" placeholder="Subject" />
          <textarea
            name="message"
            id=""
            cols="30"
            rows="10"
            placeholder="Message"
          ></textarea>
        </form>
      </div>
    </>
  );
};

export default ContactUs;
